import React from 'react'
import Home from './Home'
import { quantity } from './Home'
export default function Cartitems() {
  return (
    <div >

        <quantity.Consumer>
        {
               (tot)=>{

                return(
                    <h3>Total price of all items added in cart is :{tot}</h3>
                )
               
               }
        }

        </quantity.Consumer>
        
        <p></p>
     
    </div>
  )
}
